import React from 'react';
function Tabla(props) {
    return (
      <table className='Tabla'>
        <thead>
          <tr>
            <th>Producto</th>
            <th>Cantidad</th>
            <th>Usuario</th>
            <th>Fecha</th>
          </tr>
        </thead>
        <tbody>

          {/* <h2>{JSON.stringify(props.respuesta["0"])}</h2> */}
         {props.respuesta["0"].map((simulacion) => (
            <tr>
              <td>{JSON.stringify(simulacion.product)}</td>
              <td>{JSON.stringify(simulacion.cantidad)}</td>
              <td>{JSON.stringify(simulacion.user)}</td>
              <td>{JSON.stringify(simulacion.fecha)}</td>
            </tr> 
          ))}
        </tbody>
      </table>
    );
  }

  export default Tabla;
